const entryAttr = {
  productType: [
    {
      _id: 1,
      name: "Foam",
    },
    {
      _id: 2,
      name: "Adhesive",
    },
    {
      _id: 3,
      name: "Film",
    },
    {
      _id: 4,
      name: "Rubber Sheet",
    },
  ],
  status: [
    {
      _id: 1,
      name: "Active",
    },
    {
      _id: 2,
      name: "Inactive",
    },
  ],
};

export { entryAttr };
